import React from 'react'
import Navbar from './Navbar'
import {Link} from 'react-router-dom';
import { Stack } from '@mui/material';
import {Button} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import sideimage from '../assets/bg.jpg'



const Dashboard = () => {
  const navigate = useNavigate();
  const userId = localStorage.getItem("userId")
  const onClickHandler = (e) => {

    localStorage.removeItem("userId")
    localStorage.removeItem("uesrtoken")
    alert("Logged out succesfully")
    navigate("/")

  }
  return (
   
      
        <Stack direction="row"
          gap="40px"  
          fontSize={"24px"}
          alignItems="flex-end"
          justifyContent={'none'}
        >
            <Link to='/foodlogs' style={{textDecoration:'none',color:"#3A1212",borderBottom:'3px solid Darkblue'}}>MyFoodlogs</Link>
            <Link to='/calorielogs' style={{textDecoration:'none',color:"#3A1212",borderBottom:'3px solid Darkblue'}}>Mycalorielogs</Link>
            <Link to='/nutritionanalysis' style={{textDecoration:'none',color:"#3A1212",borderBottom:'3px solid Darkblue'}}>NutritionAnalysis</Link>
            <Link to='/searchreceipe' style={{textDecoration:'none',color:"#3A1212",borderBottom:'3px solid Darkblue'}}>Receipe Search and diet</Link>
            
            <a href="#exercises" style={{textDecoration:'none',color:"#3A1212"}}>Exercises</a>
            {userId && <Button variant='contained' mb={3} ml={30} sx={{backgroundColor:'#7EC8E3',padding:'150',width:{lg:'200px',xs:"150px"},}} onClick={onClickHandler}  >Logout</Button>}
            <img src={sideimage} alt="banner" className="hero-banner1-img"/>
        </Stack>
        
        
      
  )
}

export default Dashboard
